import React, { useContext } from 'react';

import { GlobalState } from '../../../GlobalState';

const OrderHistory = () => {
  const state = useContext(GlobalState)
  const [history] = <state className="userAPI history"></state>

  return (
    <div>
      history
    </div>
  )
}

export default OrderHistory
